import './Register.css'
import { Link } from 'react-router-dom';
function Register() {
    return (
        <div className='reg-form'>
            <form >
                <h1>REGISTER</h1>
                <label forHTML="">Name: </label>
                <input type="text" placeholder="enter your name" required />
                Age: <input type="number" placeholder="enter your age" required />
                Email: <input type="email" placeholder="enter your email" required />
                Create password: <input type="password" placeholder="enter your password" required />
                Confirm password: <input type="password" placeholder="enter your password" required />
                <Link to='/registered' className="form-btn">Register</Link>


            </form>
        </div>
    )
}
export default Register;
